import './carousel.css';
import Menu from '../menu/menu';
import Restaurants from '../restaurants/restaurant';

function Carousels(){
    return(
        <>
        <div id='slider'>
            <figure>
                <img src='https://prontorestaurant.co.ke/wp-content/uploads/2022/10/IMG_1371.jpg' alt='img1'/>
                <img src='https://prontorestaurant.co.ke/wp-content/uploads/2022/10/IMG_1371.jpg' alt='img1'/>
                <img src='https://prontorestaurant.co.ke/wp-content/uploads/2022/10/IMG_1371.jpg' alt='img1'/>
                <img src='https://prontorestaurant.co.ke/wp-content/uploads/2022/10/IMG_1371.jpg' alt='img1'/>
                <img src='https://prontorestaurant.co.ke/wp-content/uploads/2022/10/IMG_1371.jpg' alt='img1'/>
            </figure>
        </div>
        <Menu />
        <Restaurants />
        </>
    )
}

export default Carousels;
